import React from "react";
import useCardsApi from "../../hooks/useCardsApi";

const FindTheOne = () => {
  const [cards, loading, error] = useCardsApi();

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  if (!cards || cards.length === 0) {
    return <div>No cards found</div>;
  }

  return (
    <div>
      <div>
        <h1>Cards</h1>
        <ul>
          {cards.map((card) => (
            <li key={card._id}>
              <img src={card.image.url} alt={card.alt} />
              <h2>{card.title}</h2>
              <p>{card.subtitle}</p>
              <p>{card.address.country}</p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default FindTheOne;
